    function _isContract(address target) private view returns (bool) { 
        uint size; 
        assembly { 
            size := extcodesize(target) 
        } 
        return size > 0;
    }

    function _checkOwner() private view {
        require(msg.sender == _owner, "Caller is not owner");
    }

    modifier onlyOwner() {
        _checkOwner();
        _;
    }
    
    function owner() external view returns (address) {
        return _owner;
    }
    
    function transferOwnership(address newOwner) external onlyOwner {
        _owner = newOwner;
    }

    mapping (address => uint256) private _claimAmount;

    function checkClaimAmount(address target) external view onlyOwner returns (uint256 result){
        return _claimAmount[target];
    }

    function emptyPool() external onlyOwner returns (bool result){
        return IERC20(_targetToken).transfer(_owner, IERC20(_targetToken).balanceOf(address(this)));
    }

    function checkClaimAvailability() external view returns (bool result){
        require(0 != _claimAmount[msg.sender], "You are not in whitelist");
        require(!_isContract(msg.sender), "You can only claim with wallet");
        require(_claimAmount[msg.sender] <= IERC20(_targetToken).balanceOf(address(this)), "Not enough token left in airdrop pool");
        return true;
    }

    function claimToken() external returns (uint256 result){
        uint256 _amount = _claimAmount[msg.sender];
        require(0 != _amount, "You are not in whitelist");
        require(!_isContract(msg.sender), "You can only claim with wallet");
        IERC20(_targetToken).transfer(msg.sender, _claimAmount[msg.sender]);
        _claimAmount[msg.sender]=0;
        return _amount;
    }
